import React, { useState } from 'react';
import { Container, Row, Col, Card } from 'react-bootstrap';
import FileUpload from './components/FileUpload';
import DataAnalysis from './components/DataAnalysis';
import './styles/App.css';

function App() {
  const [uploadedFile, setUploadedFile] = useState(null);
  const [analysisResults, setAnalysisResults] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  return (
    <div className="app">
      <Container>
        <Row className="header">
          <Col>
            <h1>Anomaly Detection System</h1>
            <p>Upload financial transaction data to detect potential anomalies and fraud</p>
          </Col>
        </Row>
        
        <Row className="mt-4">
          <Col md={6}>
            <Card className="upload-card">
              <Card.Body>
                <Card.Title>Upload Data</Card.Title>
                <FileUpload 
                  setUploadedFile={setUploadedFile} 
                  setError={setError}
                />
              </Card.Body>
            </Card>
          </Col>
          
          <Col md={6}>
            <Card className="analysis-card">
              <Card.Body>
                <Card.Title>Analyze Data</Card.Title>
                <DataAnalysis 
                  uploadedFile={uploadedFile}
                  setAnalysisResults={setAnalysisResults}
                  loading={loading}
                  setLoading={setLoading}
                  error={error}
                  setError={setError}
                />
              </Card.Body>
            </Card>
          </Col>
        </Row>
        
        {analysisResults && (
          <Row className="mt-4">
            <Col>
              <Card className="results-card">
                <Card.Body>
                  <Card.Title>Analysis Results</Card.Title>
                  <div className="results-container">
                    <div className="algorithm-results">
                      <h4>Isolation Forest</h4>
                      <p>Anomalies detected: {analysisResults.isolation_forest.anomaly_count}</p>
                      <p>Total records: {analysisResults.isolation_forest.total_records}</p>
                    </div>
                    
                    <div className="algorithm-results">
                      <h4>Local Outlier Factor</h4>
                      <p>Anomalies detected: {analysisResults.local_outlier_factor.anomaly_count}</p>
                      <p>Total records: {analysisResults.local_outlier_factor.total_records}</p>
                    </div>
                    
                    <div className="common-anomalies">
                      <h4>Common Anomalies</h4>
                      <p>Records flagged by both algorithms: {analysisResults.common_anomalies.count}</p>
                    </div>
                  </div>
                  
                  {analysisResults.anomaly_records.length > 0 && (
                    <div className="anomaly-records mt-4">
                      <h4>Sample Anomalous Records</h4>
                      <div className="table-responsive">
                        <table className="table table-striped table-bordered">
                          <thead>
                            <tr>
                              {Object.keys(analysisResults.anomaly_records[0]).map((key) => (
                                <th key={key}>{key}</th>
                              ))}
                            </tr>
                          </thead>
                          <tbody>
                            {analysisResults.anomaly_records.map((record, index) => (
                              <tr key={index}>
                                {Object.values(record).map((value, i) => (
                                  <td key={i}>{value}</td>
                                ))}
                              </tr>
                            ))}
                          </tbody>
                        </table>
                      </div>
                    </div>
                  )}
                </Card.Body>
              </Card>
            </Col>
          </Row>
        )}
      </Container>
    </div>
  );
}

export default App;
